import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 45.2-544  Making false statements; penalty.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/45.2-544.md","filePath":"vacode/45.2-544.md"}'),n={name:"vacode/45.2-544.md"},i=r('<h1 id="§-45-2-544-making-false-statements-penalty" tabindex="-1">§ 45.2-544 Making false statements; penalty. <a class="header-anchor" href="#§-45-2-544-making-false-statements-penalty" aria-label="Permalink to &quot;§ 45.2-544  Making false statements; penalty.&quot;">​</a></h1><p>A. It is unlawful for any person charged with the making of maps or other data to be furnished as provided in the Act to fail to correctly show, within the limits of error, the data required.</p><p>B. Any person who knowingly makes any false statement, representation, or certification in any application, record, report, plan, or other document filed or required to be maintained under the Act is guilty of a Class 1 misdemeanor.</p><p>Code 1950, § 45-17; 1954, c. 191; 1966, c. 594, § 45.1-105; 1975, c. 520; 1978, c. 118; 1980, c. 388; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0028" target="_blank" rel="noreferrer">28</a>, § 45.1-161.66; 1999, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0256" target="_blank" rel="noreferrer">256</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0387" target="_blank" rel="noreferrer">387</a>.</p>',4),o=[i];function s(l,c,p,d,f,_){return t(),a("div",null,o)}const g=e(n,[["render",s]]);export{m as __pageData,g as default};
